import React,{ useReducer } from 'react';


function appReducer(state, action){
    switch (action.type){
        case value:
            break;
        default:
            state;
    }
}
const AboutUs = () => {
    const {state, dispatch} = useReducer(appReducer, []);

    return <div> Hello this is About-us page</div>;
}

export default AboutUs;
